import React from "react";
import Head from "next/head";
import classnames from "classnames";

import Header from "components/Header";
import MyStack from "components/Stack";
import Proyects from "components/Proyects";
import About from "components/About";
import Contacto from "components/Contact";
import MySkills from "components/Skills";

import styles from "./index.module.css";

const Index = () => {
  const $stack = React.useRef();

  const down = (evt) => {
    evt.preventDefault();
    $stack.current.scrollIntoView({
      behavior: "smooth",
      block: "start",
    });
  };

  return (
    <main>
      <Head>
        <link
          rel="icon"
          // href="/tablet.svg"
          href="https://media.geeksforgeeks.org/wp-content/cdn-uploads/gfg_200X200.png"
          type="image/x-icon"
        />
      </Head>

      <section>
        <div className={styles["index-container"]}>
          <div className={classnames(styles["index"], styles["center"])}>
            <Header />
            <h1 className={styles["title"]}>Luis Ángel Vásquez Nepomuceno</h1>
            <h2 className={styles["subtitle"]}>Desarrollador Front end</h2>
            <a className={styles["down"]} href="#stack" onClick={down}>
              <img src="/down.png" />
            </a>
          </div>
        </div>
        <div className={styles["stack"]} ref={$stack}>
          <MyStack />
        </div>
        <div id="skills">
          <MySkills />
        </div>

        <div id="proyects">
          <Proyects />
        </div>
        <div id="about">
          <About />
        </div>
      </section>

      <footer>
        <div id="contacto">
          <Contacto />
        </div>
      </footer>
    </main>
  );
};

export default Index;
